(72004, 'Greetings $N. Azeroth Medical is here to assist. Please see the Medical Information Agent inside for more information, or any of the Nurses.', NULL, 0, 0, 0, 0, 0, 0, 0, 0, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, 0, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, 0, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, 0, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, 0, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, 0, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, 0, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, 0),
(70007, '"Flatten the curve" refers to the effort that all of us, as citizens, can do to help relieve strain on the medical system by reducing the spread of the virus. Every community can only support so many cases in their medical facilities at a time. When you have a spike in cases, eventually it will come down when people get better. However, "Flatten the curve" means to make sure that spike stays UNDER the the maximum capacity of our ability to treat people. If it stays under, everyone who is sick can get treatment. Its up to all of us to do our part.', NULL, 0, 0, 0, 0, 0, 0, 0, 0, 'Text1_0', 'text1_1', 0, 0, 0, 0, 0, 0, 0, 0, 'text2_0', 'text2_1', 0, 0, 0, 0, 0, 0, 0, 0, 'text3_0', 'text3_1', 0, 0, 0, 0, 0, 0, 0, 0, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, 0, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, 0, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, 0, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, 0),
(72003, 'Hi $N! We\'re going to see the medical ship!!!', NULL, 0, 0, 0, 0, 0, 0, 0, 0, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, 0, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, 0, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, 0, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, 0, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, 0, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, 0, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, 0),
(70001, 'Azeroth has become infected with an unknown disease, and it is spreading rapidly to our citizens. All races of Azeroth have come together to help each other during this crisis. There is no room for discrimination.', 
