REPLACE INTO `mangos_string` (`entry`, `content_default`, `content_loc1`, `content_loc2`, `content_loc3`, `content_loc4`, `content_loc5`, `content_loc6`, `content_loc7`, `content_loc8`) VALUES 
('81000', 'You feel a tickle in your throat...', '', '', '', '', '', '', '', 'Вы чувствуете першение в горле...'),
('81001', 'You have become infected by the virus. There is nothing you can do but try to protect others. Use a face mask, wash your hands, and social distance!', '', '', '', '', '', '', '', 'Вы заразились вирусом. Вы ничего не можете сделать, кроме как попытаться защитить других. Используйте маску, мойте руки и не подходите близко к остальным.'),
('81002', 'You\'ve washed your hands and scrubbed all those nasty germs off!', '', '', '', '', '', '', '', 'Вы вымыли руки и стерли все эти грязные микробы!'),
('81003', 'Time to wash your hands!', '', '', '', '', '', '', '', 'Вам нужно помыть руки!'),
('81004', 'Hands need to be washed with soap!', '', '', '', '', '', '', '', 'Руки нужно мыть с мылом!'),
('81005', 'You are cured from virus!', '', '', '', '', '', '', '', 'Вы излечились от вируса!'),
('81006', 'You sanitized the surface from contracting any more bacteria!', '', '', '', '', '', '', '', 'Вы дезинфицировали поверхность от заражения бактериями!'),
('81007', 'You sanitized %s hands!', '', '', '', '', '', '', '', 'Вы дезинфицировали руки %s!'),
('81008', 'You sanitized your own hands!', '', '', '', '', '', '', '', 'Вы дезинфицировали свои руки!'),
('81009', 'Target too far away!', '', '', '', '', '', '', '', 'Цель слишком далеко!'),
('81010', 'Target not found!', '', '', '', '', '', '', '', 'Цель не найдена!'),
('81011', 'INFECTION NOT DETECTED!', '', '', '', '', '', '', '', 'ИНФЕКЦИЯ НЕ ОБНАРУЖЕНА!'),
('81012', 'DANGEROUS BACTERIALS DETECTED! Wash hands urgently!', '', '', '', '', '', '', '', 'ОБНАРУЖЕНЫ ОПАСНЫЕ БАКТЕРИИ! Срочно помойте руки!'),
('81013', 'INFECTION DETECTED! All attributes decreased by 5% and movement speed by 10%!', '', '', '', '', '', '', '', 'ОБНАРУЖЕНА ИНФЕКЦИЯ! Характеристики снижены на 5%, а скорость передвижения на 10%!'),
('81014', 'CLEAN HANDS! All attributes increased by 5% and movement speed by 10%!', '', '', '', '', '', '', '', 'ЧИСТЫЕ РУКИ! Характеристики повышены на 5%, а скорость передвижения на 10%!'),
('81015', 'SANITIZED! Infection spreading and infect chance decreased by 50%!', '', '', '', '', '', '', '', 'ДЕЗИНФИЦИРОВАН! Вероятность распространения и заражения инфекцией снижена на 50%!'),
('81016', 'MASK EQUIPPED! Infection spreading and infect chance decreased by 40%!', '', '', '', '', '', '', '', 'МАСКА НАДЕТА! Вероятность распространения и заражения инфекцией снижена на 40%!'),
('81017', ' TARGET : ', '', '', '', '', '', '', '', ' ЦЕЛЬ : '),
('81018', ' <BEEP!>  ', '', '', '', '', '', '', '', ' <БИП!> '),
('81019', 'You cured from virus:  %s!', '', '', '', '', '', '', '', 'Вы излечили от вируса: %s!'),
('81020', 'Target is not infected by virus!', '', '', '', '', '', '', '', 'Цель не заражена вирусом!'),
('81021', 'Player %s has cured you of the virus!', '', '', '', '', '', '', '', 'Игрок %s излечил вас от вируса!');
REPLACE INTO mangos_string (entry, content_default, content_loc8) VALUES 
(7242, 'Greetings $N. For more information please see the Medical Information Agent and the local Nurses.', 'Привет, $N. Для получения дополнительной информации, пожалуйста, обратитесь к Медицинскому представителю или местным санитарам.'),
(90011, 'wwwooowww!', 'ввввааааааууу!!'),
(90010, 'So cool!!', 'Так круто!'),
(90009, 'Wow!', 'Вау!'),
(90008, 'Look guys! Look! Its the medical ship!', 'Смотрите, ребята! Смотрите! Медицинский корабль!'),
(90007, 'The ship! The ship is under the bridge! We have to go see it!!', 'Корабль! Корабль под мостом! Мы должны увидеть это !!'),
(90006, 'Thank you and praise be to SIL.', 'Благодарность и хвала SIL.'),
(90005, 'Please remain 5 feet apart! Social Distancing is in effect to slow the spread of the virus. It is up to us as a community to flatten the curve!', 'Пожалуйста, оставайтесь на расстоянии 5 футов! Соблюдение дистанции в обществе способствует замедлению распространения вируса. Это как наш вклад в общество, чтобы сгладить кривую!'),
(90004, 'Attention! Please line up in an orderly fashion. If you are displaying symptoms, please immediately obtain a face mask and sanitizer from the Medical Dispenser.', 'Внимание! Пожалуйста, выстраивайтесь в очередь. Если у вас проявляются симптомы, пожалуйста, немедленно приобретите маску для лица и дезинфицирующее средство у Заведующего медицинскими припасами.'),
(90003, 'Don\'t fret brother - we will overcome this with the help of our medical teams. It\'s only a matter of time.', 'Не волнуйся, брат, мы преодолеем это с помощью наших медицинских бригад. Это только вопрос времени.'),
(90002, 'The disease spread so quickly ... we were not prepared.', 'Болезнь распространяется так быстро ... мы не были готовы.'),
(90001, 'Now that you\'re infected, make sure you wear a mask at all times, and sanitize your hands and surfaces!', 'Теперь, когда вы инфицированы, всегда надевайте маску и дезинфицируйте руки и поверхности!'),
(90000, 'I\'m sorry - but you\'ve been infected by the virus. Now, you must protect others.', 'Мне очень жаль, но вы заражены вирусом. Теперь ваша задача защитить других.');
REPLACE INTO `script_texts` (`entry`, `content_default`, `content_loc1`, `content_loc2`, `content_loc3`, `content_loc4`, `content_loc5`, `content_loc6`, `content_loc7`, `content_loc8`, `sound`, `type`, `language`, `emote`, `comment`) VALUES 
('-1999500', '%s feeling dizzy!', '', '', '', '', '', '', '', '%s испытывает головокружение!', '0', '0', '0', '0', ''),
('-1999501', '%s coughing!', '', '', '', '', '', '', '', '%s кашляет!', '0', '0', '0', '0', ''),
('-1999502', '%s sneezes!', '', '', '', '', '', '', '', '%s чихает!', '0', '0', '0', '0', ''),
('-1999503', 'Wash your hands with soap and water for 20 seconds to remove the virus! We\'re all in this together.', '', '', '', '', '', '', '', 'Мойте руки водой и мылом в течение 20 секунд, чтобы удалить бактерии!', '0', '0', '0', '0', ''),
('-1999504', 'Remember to keep a few feet away from all other citizens! Social distancing is integral to stopping the spread of this disease.', '', '', '', '', '', '', '', 'Держитесь на расстоянии минимум двух метров от других людей! Сохранение дистанции является неотъемлемой частью предотвращения распространения этой болезни.', '0', '0', '0', '0', ''),
('-1999505', 'Get your free sanitizer and face masks from our Supply Dispenser! Always sanitize your hands, and wear your face masks to help stop the spread!', '', '', '', '', '', '', '', 'Получите бесплатное дезинфицирующее средство и маски для лица у заведующего мед. припасами! Всегда дезинфицируйте руки и носите маски, чтобы остановить распространение.', '0', '0', '0', '0', '');
