REPLACE INTO locales_npc_text (entry, Text0_0_loc8) VALUES 
('72001', 'Мы нашли эпицентр вспышки вируса. Похоже, что Нот Чумной развил новые виды болезней, чтобы заразить Азерот. Однако одна из его зараженных летучих мышей сбежала. Мы считаем, что эта летучая мышь заразила наше население.'),
('72002', 'Да. Мы наложили магическое заклинание, которое остановит распространение болезни в этой области. Требуется огромное количество магической энергии, чтобы поддерживать это защитное поле, и мы не можем пока расширить его за пределы этих стен. Вы в безопасности здесь.'),
('72000', 'Привет $N. Я - Глава по борьбе с болезнями Эббот. Пожалуйста, будьте осторожны в движении рядом с оборудованием. Это очень хрупкое оборудование!'),
('70001', 'Азерот подвергся неизвестной болезни, которая быстро распространяется среди наших граждан. Все расы Азерота собрались вместе, чтобы помочь друг другу во время этого кризиса. Сейчас не время для разногласий.'),
('70002', 'Целители Азерота - это передовая, но вы, $N, вы - настоящее спасение от этой пандемии! Соблюдать правила карантина - это самое важное, что вы можете сделать для себя, своей семьи и своего окружения.'),
('70003', 'Каждый день, будь вы дома или на улице, тщательно мойте руки. Регулярно используйте дезинфицирующее средство (60%), особенно при прикосновении к поверхностям. Очищайте поверхности антибактериальными дезинфицирующими средствами!'),
('16777215', 'Приветствую, $N'),
('70000', 'Приветствую, $N. Целители Азерота спешат на помощь. Что тебе угодно?'),
('70004', 'Это значит, что нужно оставаться дома как можно дольше и ограничить контакты с другими. Мы рекомендуем держаться на расстоянии двух метров от других граждан, кроме тех, с кем вы живете. Наступает хорошая погода и мы не можем не подчеркнуть, насколько важно для вас держаться подальше от других людей в Азероте, которые могут неосознанно передать болезнь.'),
('70006', 'Спасибо тебе, $N. Вместе мы справимся.'),
('70005', 'Самое сложное в борьбе с этим заболеванием - это то, что оно может передаваться даже БЕЗ видимых симптомов от одного человека к другому. Кто-то может показаться здоровым, но на самом деле оказаться зараженным и передавать заболевание. Также этот вирус заражает граждан ВСЕХ ВОЗРАСТОВ. От детей до пожилых людей. Вот почему держать дистанцию в обществе так важно.'),
('71013', 'Вам не стоит предпринимать никаких действий, так как у вас нет никаких симптомов. Пожалуйста, будьте бдительны, часто мойте руки и держите дистанцию среди людей'),
('71012', 'Пожалуйста, оставайтесь дома и ограничьте контакты с другими. ВОЗ рекомендует вам самоизолироватся как минимум на 14 дней.'),
('71011', 'Был ли у вас тесный контакт с человеком, который путешествовал за пределами вашей страны в течение 14 дней и был болен?'),
('71010', 'Пожалуйста, оставайтесь дома и избегайте контактов с другими. ВОЗ рекомендует вам самоизолироватся как минимум на 14 дней.'),
('71009', 'Были ли вы в близком контакте или заботились о человеке, который уже был болен? (кашель, лихорадка, чихание, боль в горле)?'),
('71008', 'Пожалуйста, оставайтесь дома и избегайте контактов с другими. ВОЗ рекомендует вам самоизолироватся как минимум на 14 дней.'),
('71007', 'Вы путешествовали за границей своей страны в течение последних 14 дней?'),
('71006', 'Пожалуйста, оставайтесь дома и избегайте контактов с другими. ВОЗ рекомендует вам самоизолироватся как минимум на 14 дней.'),
('71005', 'Вы испытываете следующие симптомы: лихорадка, кашель, чихание, боль в горле?'),
('71004', 'Пожалуйста, проконсультируйтесь с вашим семейным врачом или позвоните по телефону в местные органы власти.'),
('71003', 'Испытываете ли вы что-либо из следующих симптомов: затрудненное дыхание от легкой до умеренной формы, неспособность лечь из-за затрудненного дыхания или хронические заболевания, с которыми вам трудно справиться из-за затрудненного дыхания?'),
('71003', 'Испытываете ли вы что-либо из следующего: отдышка от легкой до умеренной формы, неспособность лечь из-за затрудненного дыхания? Есть ли у вас хронические заболевания с которыми может быть связана отдышка?'),
('71002', 'Пожалуйста, немедленно позвоните по номеру телефона экстренной медицинской помощи и сообщите о своих симптомах, или обратитесь в ближайший центр скорой помощи.'),
('71001', 'Испытываете ли вы что-либо из следующего: сильное затруднение дыхания, сильную боль в груди, головокружение или потерю сознания?'),
('71000', 'Приветствую! Я запрограммирован, чтобы помочь вам самостоятельно оценить ваше состояние здоровья. Эти рекомендации взяты из Всемирной Организации Здравоохранения.'),
('72004', 'Привет $N. Целители Азерота спешат на помощь. Пожалуйста, обратитесь к медицинскому представителю или к любому санитару для получения дополнительной информации.'),
('70007', '"Сгладить кривую" относится к усилиям, которые мы все, как граждане, можем приложить, чтобы помочь снизить нагрузку на медицинскую систему путем снижения распространения вируса. 
REPLACE INTO `locales_item` (`entry`, `name_loc8`, `description_loc8`) VALUES 
('90001', 'Мыло для рук', 'Мыльные пузырьки сияют светом Элуны. Мойте руки с мылом, чтобы удалить бактерии прежде чем заразитесь!'),
('90002', 'Дезинфицирующее средство для рук', 'Напиток на спиртовой основе, созданный в спиртовых чанах Стальгорна во время кризиса. Используйте это, чтобы защитить себя от разных микробов и бактерий!'),
('90003', 'Маска для лица', 'N95 Маска для лица, предоставленная троллем-шаманом, Ваззули Вайлдмендером и его племенем. Используйте эту маску, чтобы защитить себя и других от заражения или распространения болезни!'),
('90004', 'Антибактериальное моющее средство', 'Лучший антибактериальный очиститель поверхностей Азерота! Удаляет 99,99% микробов со всех поверхностей. Сильвана одобряет!'),
('90005', 'Туалетная бумага', '«Только глупые люди копят туалетную бумагу во время кризиса» - Тралл'),
('90006', 'Персональный Вирус-Тестер', 'Проверяет наличие инфекции!'),
('90007', 'Мед. документ волонтера', 'В этом документе указывается, что предъявитель желает помочь Целителям Азерота в борьбе против распространения вируса. Предъявитель обязуется соблюдать правила карантина, а так же научит этому других.'),
('90008', 'Анти-вирус', 'Во время исследования логова Нота Чумного вы обнаружили флакон, заполненный противовирусным средством. Используйте его, чтобы излечить зараженного.'),
('90009', 'Миниатюрный вирус', 'Нажмите ПКМ, чтоб призвать! "Когда-то этот вирус был злом Азерота. Теперь он миленький, безобидный комочек с колючками."'),
('90010', 'Миниатюрный робот-оповещатель!', 'Нажмите ПКМ, чтоб призвать! "Дружелюбный робот-оповещатель, который всегда напоминает нам мыть руки!"');
